import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for products to get to a page with sort options
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results and sort controls to appear
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Apply price sort filter (low to high)
    await page.selectOption('#sortSelect', 'price-low');
    await page.waitForTimeout(1000); // Wait for sort to apply

    // Verify sort was applied and take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract data to verify sort was applied
    const productPrices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent.replace('$', '').replace(',', '');
        return parseFloat(priceText);
      })
    );

    // Check if prices are sorted in ascending order
    const isSorted = productPrices.every((price, i, arr) => 
      i === 0 || price >= arr[i - 1]
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) to search results",
      extractedData: {
        productCount: productPrices.length,
        prices: productPrices,
        isSorted: isSorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
